description:
Featured in Busan Indie Connect(BIC) Festival

Can you be the one to escape from this pitch-black madness?
Thriller adventure game, &quot;Dim Light&quot;

I may be the last human being who figures this situation is &quot;unnatural..&quot;
And I'm pretty sure that I'm right.

Others seem uninformed about all of this.
The dark quietly hid itself and made creepy noises.
Finallly they brought &quot;them,&quot; and they darkened the entire hospital with madness.

So...

Today, I will escape from this hell.
The dim light shining from very far ahead will eventually save my life.

